	function menu(){
		AddMenuButton('Tersane Ayar',SettingMenuClickhandler);
	}


	/*********************************************************************
	* Sol Menüye 1 buton ekler. clickhandler boş olmamalı.
	**********************************************************************/
	function AddMenuButton(caption,clickFunction){
			var tableObj = document.getElementById('menu').getElementsByTagName('table')[0];
			var newRow = document.createElement('tr');
			var newCol = document.createElement('td');
			var newDiv = document.createElement('div');
				newDiv.setAttribute("align", "center");
			var newFont = document.createElement('div');
				newFont.setAttribute("color", "ffffff");
			var newTxt = document.createTextNode(caption);
			var newLink = document.createElement('a');
				newLink.setAttribute("href", "#");
			newLink.addEventListener("click", clickFunction, false);
			newFont.appendChild(newTxt);
			newLink.appendChild(newFont);
			newDiv.appendChild(newLink);
			newCol.appendChild(newDiv);
			newRow.appendChild(newCol);
			tableObj.getElementsByTagName("tbody")[0].appendChild(newRow);
	}
	
	function SettingMenuClickhandler(){
		SettingWindow();
	}

	function CloseSetting(){
		var testNode=document.getElementById('dvMesaj')
		if(testNode!=null){
			document.body.removeChild(testNode);
		}
	}
	function SaveSetting(){
		var testNode=document.getElementById('dvMesaj')
		//Gemiler
		if(testNode!=null){
			GM_setValue(prefix+'KN',validate(document.getElementById('KN')));
			GM_setValue(prefix+'BN',validate(document.getElementById('BN')));
			GM_setValue(prefix+'HA',validate(document.getElementById('HA')));
			GM_setValue(prefix+'AA',validate(document.getElementById('AA')));
			GM_setValue(prefix+'KRU',validate(document.getElementById('KRU')));
			GM_setValue(prefix+'KOM',validate(document.getElementById('KOM')));
			GM_setValue(prefix+'KOL',validate(document.getElementById('KOL')));
			GM_setValue(prefix+'GD',validate(document.getElementById('GD')));
			GM_setValue(prefix+'CS',validate(document.getElementById('CS')));
			GM_setValue(prefix+'BOM',validate(document.getElementById('BOM')));
			GM_setValue(prefix+'MUH',validate(document.getElementById('MUH')));
			GM_setValue(prefix+'OY',validate(document.getElementById('OY')));
			GM_setValue(prefix+'FKO',validate(document.getElementById('FKO')));
			GM_setValue(prefix+'SN',validate(document.getElementById('SN')));
			GM_setValue(prefix+'UN',validate(document.getElementById('UN')));
			GM_setValue(prefix+'TER',validate(document.getElementById('TER')));
			GM_setValue(prefix+'HUB',validate(document.getElementById('HUB')));
			GM_setValue(prefix+'AUTO',validate(document.getElementById('AUTO')));
			document.body.removeChild(testNode);
		}
	}
