	function trim(str){
		return str.replace(/^\s*|\s*$/g,"");
	}
	function validate(chk){
	  if (chk.checked == 1)
		return 1;
	  else
		return 0;
	}
	function SetChkValue(chk,value){
		document.getElementById(chk).checked=value;
	}
